  [],\n\t\"revision_timestamp\": \"2015-07-21T18:27:54.582910\",\n\t\"name\": \"2014-cartographic-boundary-file-5-digit-zip-code-tabulation-area-for-united-states-1-500000bb159\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 2014 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Master Address File / Topologically Integrated Geographic Encoding and Referencing
  (MAF/TIGER) Database (MTDB). These boundary files are specifically designed for
  small-scale thematic mapping. When possible, generalization is performed with the
  intent to maintain the hierarchical relationships among geographies and to maintain
  the alignment of geographies within a file set for a given year. Geographic areas
  may not align with the same areas from another year. Some geographies are available
  as nation-based files while others are available only as state-based files.nnZIP
  Code Tabulation Areas (ZCTAs) are approximate area representations of U.S. Postal
  Service (USPS) ZIP Code service areas that the Census Bureau creates to present
  statistical data for each decennial census. The Census Bureau delineates ZCTA boundaries
  for the United States, Puerto Rico, American Samoa, Guam, the Commonwealth of the
  Northern Mariana Islands, and the U.S. Virgin Islands once each decade following
  the decennial census. Data users should not use ZCTAs to identify the official USPS
  ZIP Code for mail delivery. The USPS makes periodic changes to ZIP Codes to support
  more efficient mail delivery.nnThe Census Bureau uses tabulation blocks as the basis
  for defining each ZCTA. Tabulation blocks are assigned to a ZCTA based on the most
  frequently occurring ZIP Code for the addresses contained within that block. The
  most frequently occurring ZIP Code also becomes the five-digit numeric code of the
  ZCTA. These codes may contain leading zeros.nnBlocks that do not contain addresses
  but are surrounded by a single ZCTA (enclaves) are assigned to the surrounding ZCTA.
  Because the Census Bureau only uses the most frequently occurring ZIP Code to assign
  blocks, a ZCTA may not exist for every USPS ZIP Code. Some ZIP Codes may not have
  a matching ZCTA because too few addresses were associated with the specific ZIP
  Code or the ZIP Code was not the most frequently occurring ZIP Code within any of
  the blocks where it exists.nnThe generalized ZCTA boundaries in this file are based
  on those delineated following the 2010 Census.\",\n\t\"license_title\": null,\n\t\"extras\":
